import React, {useState} from "react";
import {View, Text, TextInput, TouchableOpacity} from "react-native"

const Register = ({navigation}) => {
    return(
        <View>
        <Text style={{
            fontSize: 25
        }}>Register Page</Text>
    </View>
    )
}

export default Register;
